import { Box } from "@mui/system";
import image from '../Books/images/book.png'
function Book(props){


    return(
        <Box sx={{
            position:'relative',
            top:50,

            width:'90vw',
            height:'90vh',
            backgroundColor:'white',
            border:'1px solid green',
            display:'flex',
            flexDirection:'row',
            justifyContent:"center"

        }}>
            <Box sx={{width:'40%',height:'50%',border:'1px solid yellow'}}>
                <img src={ image} style={ {width:'100%',height:'100%'}}/>
            </Box>
            <Box sx={{width:'60%',height:'80%',border:'1px solid yellow'}}></Box>

        </Box>
    )
}
export default Book
